import React from 'react';
import './App.css';
import './bootstrap.min.css';
import Header from './header.js'
import Createpokemon from './Createpokemon.js'


class teambuilding extends React.Component{
	constructor(props){
		super(props);
		this.state = {
			view : [],
			onChange : []
		}
	}
	render(){
		return(
			<div>
				<Header view={this.state.view} onChange={this.onChange}/>
				<div>
					{this.props.view}
				</div>
			</div>
		)
	}	
}

export default teambuilding;
